USE CTUDB
GO

IF EXISTS(SELECT 1 FROM sys.tables WHERE object_id = OBJECT_ID('[Auckland_Park].[Person]'))
BEGIN;
    DROP TABLE [Auckland_Park].[Person];
END;
GO

CREATE TABLE [Auckland_Park].[Person] (
    [PersonID] INTEGER NOT NULL UNIQUE IDENTITY(1, 1),
    [ID_Number] VARCHAR(13) NOT NULL UNIQUE,
    [Name] VARCHAR(255) NULL,
    [Surname] VARCHAR(255) NULL,
    [Street] VARCHAR(255) NULL,
    [City] VARCHAR(255) NULL,
    [Country] VARCHAR(50) NULL,
    PRIMARY KEY ([PersonID])
);
GO






